import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-dark bg-dark">
     <a class="nav-link active" href="/">Google Books</a>
     <a class="nav-link" href="#">Search</a>
  <a class="nav-link" href="#">Saved</a>
    </nav>
  );
}

export default Nav;
